// use this module to cherry pick functions into your prototype
// (useful for functions shared between the core and collections, for example)

// e.g.
// let foo = define.foo({ /* params... */ })

import * as util from 'cytoscape/src/util';
import animation from 'cytoscape/src/define/animation';
import data from 'cytoscape/src/define/data';
import events from 'cytoscape/src/define/events';

let define = {};

[
  animation,
  data,
  events
].forEach(function( m ){
  util.assign( define, m );
});

export default define;
